#https://leetcode.com/problems/counting-words-with-a-given-prefix/

class Solution:
    def prefixCount(self, words, pref: str) -> int:
        count = 0
        for word in words:
            #check
            if pref in word and pref == word[:len(pref)]:
                count+=1
        print(count)
        return count


